    public void sort(double x[][],double xf[]) {
	if (x.length == 0)
	    return;
	int n = x[0].length;
	double t[][] = new double[x.length][n+1];
	for (int i=0;i<x.length;i++) {
	    for (int j=0;j<n;j++) {
		t[i][j] = x[i][j];
	    }
	    t[i][n] = xf[i];
	}

	SCE_Comparator comparator = new SCE_Comparator(n,false);
        java.util.Arrays.sort(t,comparator);

	for (int i=0;i<x.length;i++) {
	    for (int j=0;j<n;j++) {
		x[i][j] = t[i][j];
	    }
	    xf[i] = t[i][n];
	}
    }

