    public double NormalizedgeometricRange(double x[][],double bound[]) {
	if (x.length == 0)
	    return 0;
	int n = x[0].length;

	double min[] = new double[n];
	double max[] = new double[n];

	double mean = 0;

	for (int i=0;i<n;i++) {
	    min[i] = Double.POSITIVE_INFINITY;
	    max[i] = Double.NEGATIVE_INFINITY;

	    for (int j=0;j<x.length;j++) {
		if (x[j][i] < min[i])
		    min[i] = x[j][i];
		if (x[j][i] > max[i])
		    max[i] = x[j][i];
	    }

	    mean += Math.log(max[i] - min[i])/bound[i];
	}
	mean/=n;
	return Math.exp(mean);
    }

    public double[] std(double x[][]) {
	if (x.length == 0)
	    return null;
	if (x.length == 1)
	    return null;

	int n = x[0].length;

	double mean[] = new double[n];
	double var[] = new double[n];

	for (int i=0;i<n;i++) {
	    mean[i] = 0;
	    for (int j=0;j<x.length;j++) {
		mean[i] += x[j][i];
	    }
	    mean[i] /= n;
	}

	for (int i=0;i<n;i++) {
	    var[i] = 0;
	    for (int j=0;j<x.length;j++) {
		var[i] += (mean[i] - x[j][i])*(mean[i] - x[j][i]);
	    }
	    var[i] = Math.sqrt(var[i])/(n-1);
	}

	return var;
    }

    public int find(int lcs[],int startindex,int endindex,int value) {
	for (int i=startindex;i<endindex;i++) {
	    if (lcs[i] == value)
		return i;
	}
	return -1;
    }
    //s forms the simplex
    //sf function values of simplex
    //bl lower bound, bu upper bound
    public double[] cceua( double s[][],double sf[],double bl[],double bu[]) {
	int nps = s.length;
	int nopt = s[0].length;

	int n = nps;
	int m = nopt;

	double alpha = 1.0;
	double beta = 0.5;

	// Assign the best and worst points:
	double sb[] = new double[nopt];
	double sw[] = new double[nopt];
	double fb = sf[0];
	double fw = sf[n-1];

	for (int i=0;i<nopt;i++) {
	    sb[i] = s[0][i];
	    sw[i] = s[n-1][i];
	}

	// Compute the centroid of the simplex excluding the worst point:
	double ce[] = new double[nopt];
	for (int i=0;i<nopt;i++) {
	    ce[i] = 0;
	    for (int j=0;j<n-1;j++) {
		ce[i] += s[j][i];
	    }
	    ce[i] /= (n-1);
	}

	// Attempt a reflection point
	double snew[] = new double[nopt];
	for (int i=0;i<nopt;i++) {
	    snew[i] = ce[i] + alpha*(ce[i]-sw[i]);
	}

	// Check if is outside the bounds:
	int ibound=0;
	for (int i=0;i<nopt;i++) {
	    if ( (snew[i]-bl[i]) < 0 )
		ibound = 1;
	    if ( (bu[i]-snew[i]) < 0 )
		ibound = 2;
	}

	if (ibound >=1) {
	    snew = this.RandomSampler();
	}

	double fnew = funct(snew);

	// Reflection failed; now attempt a contraction point:
	if (fnew > fw) {
	    for (int i=0;i<nopt;i++) {
		snew[i] = sw[i] + beta*(ce[i]-sw[i]);
	    }
	    fnew = funct(snew);
	}
	// Both reflection and contraction have failed, attempt a random point;
	if (fnew > fw) {
	    snew = this.RandomSampler();
	    fnew = funct(snew);
	}

	double result[] = new double[nopt+1];
	for (int i=0;i<nopt;i++) {
	    result[i] = snew[i];
	}
	result[nopt] = fnew;
	return result;
    }

